import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class PublicoService {

  private valorUsuario: any; // Variable para almacenar el valor

  constructor() { }

  getValor(): any {
    return this.valorUsuario;
  }

  setValor(valor:any) {
    this.valorUsuario = valor;
  }
}
